import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";




function App() {
  return (
    <div>
      <Header />
     { notes.map(forNote =>
    <Note 
      key = {forNote.key }
      title = {forNote.title} 
      content = {forNote.content}
    /> )}

      <Footer />
    </div>
  );
}

export default App;
